      b 27.02.1948
      Jane b. at Vancouver, Canada, and m. at Sydney, Australia. Divorced. John, s/o John Allen and
      Frances Rooney, b, at Liverpool, England. Address: 33a Mons Avenue, West Ryde 2114, NSW,
      Australia.
      Jane moved to Sydney in 1965, completed high school matriculation and trained as a travel
      consultant as well as continuing studies in Indonesian language. She worked for the Dutch and then
      the Indonesian national airlines until she left to start her family in 1979. For the next few
      years she remained involved primarily with her children and their activities, and was coordinator
      of the local playgroup.
      Jane lived with her family in Jakarta, Indonesia, for two and a half years, from 1987 to 1989, then
      returned to Australia and resumed work for the Indonesian national carrier in 1990. She is
      currently Australian Marketing Coordinator.
